news-feed\items\httpsfeedqgisorg\entries\items\64\content="<p>OpenStreetMap (OSM) is free to use, but not free to run. The QGIS user experience is tremendously improved thanks to OSM data, tiles, geocoding, and other services. OSM depends on donations from people like you! <strong>Double-click</strong> this entry to learn how to support OSM's continued stability, quality, and independence.</p>"
